import React from "react";
import CarouzelItem from "./CarouselItem";
import carouzelData from "../carousel.json";
function Craousel() {
  const carouzelItems = carouzelData.map((item) => {
    return item.id === 1 ? (
      ""
    ) : (
      <CarouzelItem key={item.id} imgUrl={item.imgUrl} />
    );
  });
  return (
    <div id="carouselID" class="carousel slide" data-ride="carousel">
      <div class="carousel-inner">
        <div class="carousel-item active">
          <img
            class="d-block w-100"
            src={carouzelData[0].imgUrl}
            alt="0 slajd"
          />
        </div>
        {carouzelItems}
      </div>
      <a
        class="carousel-control-prev"
        href="#carouselID"
        role="button"
        data-slide="prev"
      >
        <span class="carousel-control-prev-icon" aria-hidden="true"></span>
        <span class="sr-only">Previous</span>
      </a>
      <a
        class="carousel-control-next"
        href="#carouselID"
        role="button"
        data-slide="next"
      >
        <span class="carousel-control-next-icon" aria-hidden="true"></span>
        <span class="sr-only">Next</span>
      </a>
    </div>
  );
}
export default Craousel;
